import headerphoto from './img/Header.jpeg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="Logo-container">
          <div className="Logo-text">
            JONAH SAFFRAN PRODUCTIONS
          </div>
        </div>
      </header>
      <body className="App-body">
        JONAH SAFFRAN PRODUCTIONS
        <div className="Carousel-1">
        <img src="https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/beck1.jpg" width="100%"/>
        <img src="https://jonahsaffranphotos.s3.us-west-1.amazonaws.com/img/beck1.jpg" width="100%"/>
        </div>
      </body>
    </div>
  );
}

export default App;
